import Layout from '../comps/MyLayout';
import Link from 'next/link';

const PostLink = props => (
    <li>
        <Link href={`/post?title=${props.title}`}>
            <a>{props.title}</a>
        </Link>
    </li>
)

export default function Blog() {
    return (
            <Layout>
                <h1>My Blog</h1>
            </Layout>
    )
}
